import Illustration from '../assets/Capture.PNG'

const Home = () => {
    return (
        <div className='flex'>
            <div className="text  flex-1 ">
            <h1 className="float-left font-openSans font-extrabold text-6xl leading-normal my-auto ml-5">Need a hand in  <br/>managing college work ?? <br/>We got you!</h1>
            </div>
            <img src={Illustration} className='w-2/5 float-right  mr-6 flex-1' alt="pic"></img>

            

        </div>
    )
}

export default Home
